"261":{"id":"261","name":"Gata em Teto de Zinco Quente","slug":"gata-em-teto-de-zinco-quente","original_title":"Cat on a Hot Tin Roof","overview":"Brick, um ex famoso jogador de futebol, agora alcoólico, rejeita a bela mulher Maggie, culpando-a de ter abandonado a sua carreira profissional. De igual modo, Brick rejeita também o seu pai, Harvey, que está morrendo com um câncer, porque nunca mantiveram uma relação aberta e são demasiados orgulhosos para se tornaram próximos agora. No aniversário de Harvey, a família encontra-se reunida, incluindo o seu outro filho, um ambicioso advogado, acompanhado pela mulher, uma pessoa demasiado intrometida. Será nesta noite inesquecível, que todas as verdades serão ditas...","first_air_date":"1958-08-29","runtime":108,"episode_run_time":[108],"vote_average":7.7,"created_by":["Avon Productions","Metro-Goldwyn-Mayer"],"production_companies":[{"name":"Avon Productions"},{"name":"Metro-Goldwyn-Mayer"}],"cast":["Paul Newman","Elizabeth Taylor","Burl Ives","Judith Anderson","Jack Carson"],"backdrop_path":"https://image.tmdb.org/t/p/original/3Yz8IcUBPZ8zDff0ktHZk24Rot0.jpg","poster_path":"https://image.tmdb.org/t/p/original/uaEwrRGBDSlLp3NRvY7KQFzmOSf.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
