"330982":{"id":"330982","name":"A Infância de um Líder","slug":"a-infancia-de-um-lider","original_title":"The Childhood of a Leader","overview":"A Infância de um Líder é uma visão alegórica e arrepiante sobre a ascensão do fascismo no Século XX. Conta a história de um jovem rapaz americano que vive em França em 1918 e cujo pai trabalha para o governo dos Estados Unidos na criação do Tratado de Versalhes. O que ele testemunha acabar por lhe moldar os seus ideais e personalidade, fazendo nascer um ego aterrador. Vagamente inspirado na experiência de infância de muitos dos grandes ditadores do século XX e impregnado com uma realidade assustadora, A Infância de um Líder é um retrato realista da emergência do mal.","first_air_date":"2016-07-22","runtime":115,"episode_run_time":[115],"vote_average":6.2,"created_by":["Bow + Arrow Entertainment","Bron Capital Partners","Scion Pictures","Crystal Wealth","Unanimous Entertainment","MACT Productions","Filmteam","Studio l'Équipe","SCOPE Pictures"],"production_companies":[{"name":"Bow + Arrow Entertainment"},{"name":"Bron Capital Partners"},{"name":"Scion Pictures"},{"name":"Crystal Wealth"},{"name":"Unanimous Entertainment"},{"name":"MACT Productions"},{"name":"Filmteam"},{"name":"Studio l'Équipe"},{"name":"SCOPE Pictures"}],"cast":["Bérénice Bejo","Liam Cunningham","Stacy Martin","Yolande Moreau","Jacques Boudet"],"backdrop_path":"https://image.tmdb.org/t/p/original/maRJmkEt9GnWjVMqEETdc9Mf6Ng.jpg","poster_path":"https://image.tmdb.org/t/p/original/3USQN8KHUy605en0gHDWUNM0CFS.jpg","certification":"N/A","genres":["Drama"],"trailer":"Q9jSkde3q5o"},
