"28528":{"id":"28528","name":"A Trágica Farsa","slug":"a-tragica-farsa","original_title":"The Harder They Fall","overview":"O desempregado jornalista desportivo Eddie Willis, é contratado pelo promotor de luta corrupto Nick Benko para promover seu atual protegido, um boxeador argentino desconhecido chamado Toro Moreno. Embora Moreno seja um gigante, suas chances de sucesso são prejudicadas por um soco fraco e um queixo de vidro. Explorando a reputação de Willis para melhorar sua posição na comunidade do boxe, Benko organiza uma série de lutas arranjadas que impulsionam o ingênuo Moreno a lutador número 1 para o campeonato. O campeão reinante, o sádico Buddy Brannen, guarda ressentimento pela publicidade que Toro recebeu e promete puni-lo violentamente no ringue. Eddie agora deve decidir se deve ou não contar ao ingênuo Toro a verdade. (e 16 - Estimado 16 Anos)","first_air_date":"1956-05-08","runtime":109,"episode_run_time":[109],"vote_average":7.1,"created_by":["Columbia Pictures"],"production_companies":[{"name":"Columbia Pictures"}],"cast":["Humphrey Bogart","Rod Steiger","Jan Sterling","Mike Lane","Max Baer"],"backdrop_path":"https://image.tmdb.org/t/p/original/wLx7DUmPu2S6jPlhyfdnEWYLlb5.jpg","poster_path":"https://image.tmdb.org/t/p/original/64myyQG1sPXTPEHvgCGXWbcwVFh.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
