"763873":{"id":"763873","name":"Under Wraps: Uma Múmia no Halloween","slug":"under-wraps-uma-mumia-no-halloween","original_title":"Under Wraps","overview":"No Halloween, Marshall, Gilbert e Amy concordam em ajudar uma múmia de 3000 anos a reencontrar o seu amor perdido antes que seja tarde demais. Eles vão arriscar as suas vidas para obstruir o plano de um ladrão para vender o sarcófago da múmia. As crianças terão que correr contra o tempo para devolver o seu novo amigo ao seu lugar de descanso antes que se torne pó e perca a sua alma para sempre.","first_air_date":"2021-10-01","runtime":91,"episode_run_time":[91],"vote_average":6.8,"created_by":["MarVista Entertainment","Lighthouse Pictures","Disney Branded Television"],"production_companies":[{"name":"MarVista Entertainment"},{"name":"Lighthouse Pictures"},{"name":"Disney Branded Television"}],"cast":["Malachi Barton","Christian J. Simon","Sophia Hammons","Phil Wright","Melanie Brook"],"backdrop_path":"https://image.tmdb.org/t/p/original/ycqMcQ1t1RPxR4aN46SM2Z1P7qd.jpg","poster_path":"https://image.tmdb.org/t/p/original/yLnC8LxHyGEhZ1xnqxgjZhzYH7q.jpg","certification":"12","genres":["Família","Comédia","Fantasia"],"trailer":"N/A"},
"53596":{"id":"53596","name":"Conflito das Águas","slug":"conflito-das-aguas","original_title":"También la lluvia","overview":"Uma equipe de filmagem espanhola, de baixo orçamento, chega em Cochabamba, Bolívia, para rodar um filme sobre a chegada de Cristóvão Colombo, e a relação dos conquistadores espanhóis, que praticamente dizimaram a civilização indigena que ali habitava, explorando-os comercialmente, e matando os insubordinados. A equipe escala atores e figurantes locais, mas o que não esperavam é que a população enfrenta o governo, por conta do uso de água, e isso atrapalha o rendimento das filmagens, pondo em risco a vida de todos, após a eclosão de uma rebelião civil.","first_air_date":"2011-01-05","runtime":103,"episode_run_time":[103],"vote_average":6.9,"created_by":["Vaca Films","Morena Films","Alebrije Producciones","Mandarin Cinéma"],"production_companies":[{"name":"Vaca Films"},{"name":"Morena Films"},{"name":"Alebrije Producciones"},{"name":"Mandarin Cinéma"}],"cast":["Luis Tosar","Gael García Bernal","Juan Carlos Aduviri","Karra Elejalde","Raúl Arévalo"],"backdrop_path":"https://image.tmdb.org/t/p/original/wIgN4qGIydCAkgeFfPomqLRqRbg.jpg","poster_path":"https://image.tmdb.org/t/p/original/844Rf5ln8QjRdf5ZEgt9dbHP9Mp.jpg","certification":"N/A","genres":["Drama","História"],"trailer":"N/A"},
"450932":{"id":"450932","name":"Resposta Armada","slug":"resposta-armada","original_title":"Armed Response","overview":"Uma equipe de trabalhadores altamente treinada fica sem saída dentro de uma base militar após o sistema de segurança subitamente entrar em pane. O grupo começa a presenciar terríveis fenômenos enquanto tentam descobrir o que matou a equipe anterior.","first_air_date":"2017-08-04","runtime":93,"episode_run_time":[93],"vote_average":5.1,"created_by":["WWE Studios","Saban Films","Erebus Pictures","Maandi Films","Voltage Pictures"],"production_companies":[{"name":"WWE Studios"},{"name":"Saban Films"},{"name":"Erebus Pictures"},{"name":"Maandi Films"},{"name":"Voltage Pictures"}],"cast":["Wesley Snipes","Anne Heche","Dave Annable","Colby Lopez","Kyle Clements"],"backdrop_path":"https://image.tmdb.org/t/p/original/rcYoFja1KidJlTzQCHoxLHaw1AO.jpg","poster_path":"https://image.tmdb.org/t/p/original/8GNP6bduEXgh5bcHhon6Xp3X5O2.jpg","certification":"N/A","genres":["Ação","Terror","Thriller"],"trailer":"N/A"},
