"1988":{"id":"1988","name":"O Preço da Coragem","slug":"o-preco-da-coragem","original_title":"A Mighty Heart","overview":"23 de janeiro de 2003. Daniel Pearl (Dan Futterman), chefe da sucursal do Wall Street Journal no sudeste asiático, está trabalhando numa matéria sobre um homem-bomba chamado Richard Reid. Sua pesquisa o levou a Karashi, onde um intermediário lhe prometeu uma boa fonte. Quando Daniel saiu para a entrevista avisou Mariane (Angelina Jolie), sua esposa, de que talvez voltasse tarde. Porém ele jamais retornou. Grávida de 6 meses, Mariane decidiu escrever um livro para apresentar a seu filho quem era seu pai, que ele não conheceria.","first_air_date":"2007-06-22","runtime":108,"episode_run_time":[108],"vote_average":6.4,"created_by":["Plan B Entertainment","Revolution Films","Paramount Vantage"],"production_companies":[{"name":"Plan B Entertainment"},{"name":"Revolution Films"},{"name":"Paramount Vantage"}],"cast":["Angelina Jolie","Dan Futterman","Irrfan Khan","Archie Panjabi","Denis O'Hare"],"backdrop_path":"https://image.tmdb.org/t/p/original/zjVE6yJE3UvQbBTB6QbiN3fK52m.jpg","poster_path":"https://image.tmdb.org/t/p/original/c3c3mQMsXetfWiqQTesyMZsK8G2.jpg","certification":"N/A","genres":["Drama","Thriller","História"],"trailer":"5WQ_Dj5a2Xc"},
