"19366":{"id":"19366","name":"Josie e as Gatinhas","slug":"josie-e-as-gatinhas","original_title":"Josie and the Pussycats","overview":"Josie (Rachel Leigh Cook), Valerie (Rosario Dawson) e Melody (Tara Reid) não se importam com o que está na moda ou o que é mais popular no momento. As três formam a banda Josie e as Gatinhas, fazem shows vestidas como gatas e estão mais interessadas em criar seu próprio estilo como banda de rock'n'roll. Um dia elas são descobertas por Wyatt Frame (Alan Cummings), um empresário musical que logo consegue para elas um contrato com a Mega Records e faz com que a banda se torne um sucesso nacional. Mas nem tudo são flores: Fiona (Parker Posey), que trabalha na Mega Records, pretende utilizar a banda para controlar a juventude da América através da música e, ao descobrir tais intenções, Josie e suas amigas farão de tudo para limpar seus nomes.","first_air_date":"2001-04-06","runtime":98,"episode_run_time":[98],"vote_average":5.6,"created_by":["Universal Pictures","Metro-Goldwyn-Mayer","Marc Platt Productions","Riverdale Productions","Edmonds Entertainment Group"],"production_companies":[{"name":"Universal Pictures"},{"name":"Metro-Goldwyn-Mayer"},{"name":"Marc Platt Productions"},{"name":"Riverdale Productions"},{"name":"Edmonds Entertainment Group"}],"cast":["Rachael Leigh Cook","Rosario Dawson","Tara Reid","Alan Cumming","Parker Posey"],"backdrop_path":"https://image.tmdb.org/t/p/original/wkQAYth62cJXsvqkYbDH8b1cqES.jpg","poster_path":"https://image.tmdb.org/t/p/original/vvKAoWj1kxj8tofpktatJ2D9w91.jpg","certification":"N/A","genres":["Comédia","Música"],"trailer":"N/A"},
