"275601":{"id":"275601","name":"Ricki and the Flash: De Volta pra Casa","slug":"ricki-and-the-flash-de-volta-pra-casa","original_title":"Ricki and the Flash","overview":"Com mais de 50 anos de idade, Ricki é uma cantora de rock, que sempre se apresenta com a banda The Flash em um pequeno bar. A situação financeira é precária, e ela não vê os filhos adultos há décadas. Um dia, o ex-marido Pete liga para Ricki, avisando que a filha Julie foi abandonada pelo marido, e pedindo ajuda para tirá-la de um estado depressivo. Reticente, a mãe retorna ao lar, e descobre que tanto Julie quanto seus dois irmãos têm muito ressentimento por causa do abandono quando eram crianças. Essa é a oportunidade para Ricki fazer as pazes e tentar ser mais presente na vida deles.","first_air_date":"2015-07-10","runtime":100,"episode_run_time":[100],"vote_average":5.8,"created_by":["LStar Capital","Clinica Estetico","TriStar Pictures","Marc Platt Productions"],"production_companies":[{"name":"LStar Capital"},{"name":"Clinica Estetico"},{"name":"TriStar Pictures"},{"name":"Marc Platt Productions"}],"cast":["Meryl Streep","Kevin Kline","Mamie Gummer","Sebastian Stan","Audra McDonald"],"backdrop_path":"https://image.tmdb.org/t/p/original/buqelo9doOLvFDMWhXmQ3FcH5HS.jpg","poster_path":"https://image.tmdb.org/t/p/original/wdHlB6EYUrrrIh96nvuaKnyK88A.jpg","certification":"14","genres":["Comédia","Drama","Música"],"trailer":"N/A"},
"11137":{"id":"11137","name":"Um Príncipe em Minha Vida","slug":"um-principe-em-minha-vida","original_title":"The Prince & Me","overview":"Edward é um jovem príncipe dinamarquês, que deseja levar uma vida comum. Para tanto decide se mudar para os Estados Unidos, onde poderá levar a vida do jeito que quiser. Lá ele conhece e se apaixona por Paige, que a princípio não sabe de suas raízes na realeza dinamarquesa. Quando Edward precisa assumir o reinado, cabe a Paige ter uma decisão que poderá mudar sua vida: ir com ele e se tornar rainha ou permanecer nos Estados Unidos e realizar o sonho de ser médica?","first_air_date":"2004-03-28","runtime":111,"episode_run_time":[111],"vote_average":6.2,"created_by":["Stillking Films","Sobini Films","Epsilon Motion Pictures","Paramount Pictures","Lionsgate"],"production_companies":[{"name":"Stillking Films"},{"name":"Sobini Films"},{"name":"Epsilon Motion Pictures"},{"name":"Paramount Pictures"},{"name":"Lionsgate"}],"cast":["Julia Stiles","Luke Mably","Ben Miller","Miranda Richardson","James Fox"],"backdrop_path":"https://image.tmdb.org/t/p/original/u70yZonRQy8WOURASeTmxhKWDIT.jpg","poster_path":"https://image.tmdb.org/t/p/original/5mrVelvqeQ0eb6lYRTVhMEZSsLM.jpg","certification":"10","genres":["Comédia","Romance"],"trailer":"N/A"},
