"10373":{"id":"10373","name":"Quadrophenia","slug":"quadrophenia","original_title":"Quadrophenia","overview":"Na Londres de 1964 Jimmy Cooper é um membro de uma gangue Mod - jovens bem vestidos que dirigem vespas Lambretta. Os mods estão sempre brigando com os Rockers, que vestem jaquetas de couro e dirigem motocicletas. Desiludido com seus pais e seu emprego, Jimmy só encontra uma válvula de escape para sua angústia adolescente quando está com seus amigos mods Dave, Chalky e Spider. Um feriado de três dias é a desculpa para a rivalidade entre as duas gangues chegar às vias de fato, enquanto ambas descem para a cidade litorânea de Brighton para o confronto definitivo.Quadrophenia é uma reflexão sobre a Grã-Bretanha pré-Tatcher, documentando o narcisismo movido a anfetaminas da cultura jovem dos anos 60. Em 2004 a revista Total Film elegeu Quadrophenia o 35º melhor filme britânico de todos os tempos.","first_air_date":"1979-09-14","runtime":120,"episode_run_time":[120],"vote_average":7.0,"created_by":["Polytel","The Who Films"],"production_companies":[{"name":"Polytel"},{"name":"The Who Films"}],"cast":["Phil Daniels","Leslie Ash","Phil Davis","Mark Wingett","Sting"],"backdrop_path":"https://image.tmdb.org/t/p/original/n31i51vwTOOUxKd1DWU2r6if0XR.jpg","poster_path":"https://image.tmdb.org/t/p/original/4sRR3pvrAZMG7GEvnR9XzqyHHfD.jpg","certification":"N/A","genres":["Drama","Música"],"trailer":"N/A"},
