"11694":{"id":"11694","name":"Dívida de Sangue","slug":"divida-de-sangue","original_title":"Cat Ballou","overview":"A fazenda da família de Catherine \"Cat\" Ballou (Jane Fonda) está sendo ameaçada pela estrada de ferro. Quando seu pai é morto pelo pistoleiro do magnata da ferrovia, ela resolve para lutar. Contrata o pistoleiro Kid Shelleen (Lee Marvin), e descobre que ele é o pistoleiro mais \"pinguço\" do oeste. Shelleen consegue montar à cavalo de forma tosca em várias cenas, enquanto os menestréis Sunrise Kid (Nat King Cole) e Sam the Shade (Stubby Kaye) narram a história cantando a balada de Cat Ballou.","first_air_date":"1965-06-24","runtime":97,"episode_run_time":[97],"vote_average":6.4,"created_by":["Harold Hecht Productions","Columbia Pictures"],"production_companies":[{"name":"Harold Hecht Productions"},{"name":"Columbia Pictures"}],"cast":["Jane Fonda","Lee Marvin","Michael Callan","Dwayne Hickman","Nat King Cole"],"backdrop_path":"https://image.tmdb.org/t/p/original/vITHhBDV2t4QIT9UBcLl4zEa7Zy.jpg","poster_path":"https://image.tmdb.org/t/p/original/6FFbb0W56A0uEd7n5RtoCx1DmEJ.jpg","certification":"12","genres":["Faroeste","Comédia"],"trailer":"N/A"},
