"18079":{"id":"18079","name":"Nove Rainhas","slug":"nove-rainhas","original_title":"Nueve reinas","overview":"A história de Nove Rainhas, passada na Buenos Aires dos dias atuais, começa numa madrugada e termina na manhã do dia seguinte. Nestas 24 horas ou pouco mais, Marcos e Juan, seus protagonistas, passarão pela maior aventura de suas vidas, algo que Marcos insiste em chamar de \"uma oportunidade em um milhão\". Estes dois golpistas de segunda, que habitualmente \"trabalhavam\" por alguns poucos pesos, se conhecem por acaso numa certa madrugada e, de repente, tornam-se sócios numa negociação multimilionária envolvendo uma série falsificada de selos raríssimos, conhecidos como as \"Nove Rainhas\". O negócio deve ser realizado imediatamente, custe o que custar, uma vez que o milionário espanhol interessado nos selos deixará a cidade na manhã seguinte. Marcos conta com a ajuda de sua irmã, Valeria, que trabalha no hotel onde o espanhol está hospedado, mas questões familiares pendentes azedam a relação dos irmãos.","first_air_date":"2000-08-31","runtime":114,"episode_run_time":[114],"vote_average":7.8,"created_by":["Patagonik","FX Sound","Industrias Audiovisuales Argentinas S.A.","J.Z. & Asociados","Kodak Argentina S.A.","INCAA","Naya Films SA"],"production_companies":[{"name":"Patagonik"},{"name":"FX Sound"},{"name":"Industrias Audiovisuales Argentinas S.A."},{"name":"J.Z. & Asociados"},{"name":"Kodak Argentina S.A."},{"name":"INCAA"},{"name":"Naya Films SA"}],"cast":["Ricardo Darín","Gastón Pauls","Leticia Brédice","Gabo Correa","Pochi Ducasse"],"backdrop_path":"https://image.tmdb.org/t/p/original/dQkITkSrvtQ8rdA69XJRaKNE8V4.jpg","poster_path":"https://image.tmdb.org/t/p/original/81dNUMGIB55L8PxYHkcWUG594og.jpg","certification":"14","genres":["Crime","Thriller","Drama"],"trailer":"Awu9WonTVB0"},
