"40820":{"id":"40820","name":"Palco de Ilusões","slug":"palco-de-ilusoes","original_title":"Punchline","overview":"Comédia não é um problema para os vencedores do Oscar ® Sally Field* e Tom Hanks** , que dominam o palco no grande sucesso PALCO DE ILUSÕES. Field (Forrest Gump, Uma Babá Quase Perfeita) estrela como Lilah Krytsick, uma dona de casa e mãe de três filhos que sonha em ser uma grande comediante. Durante toda sua vida, as pessoas ressaltaram seu Dom para a comédia e agora sua rotina está de pernas para o ar porque suas noites são passadas no palco do clube Gas Station em Nova York. Hanks (O Naúfrago, O Resgate do Soldado Ryan) é Steven Gold, um ator egoísta que rouba a cena com seu talento natural para a comédia. Atraídos, Steven ajuda a iniciante Lilah a transformar seu show em algo divertido e Lilah ajuda Steven a se manter longe de encrenca. Com performances aclamadas de Hanks e Field, PALCO DE ILUSÕES é um drama fascinante sobre o mundo da comédia.","first_air_date":"1988-10-07","runtime":123,"episode_run_time":[123],"vote_average":5.4,"created_by":["Columbia Pictures"],"production_companies":[{"name":"Columbia Pictures"}],"cast":["Sally Field","Tom Hanks","John Goodman","Mark Rydell","Kim Greist"],"backdrop_path":"https://image.tmdb.org/t/p/original/sjeuEHadWkWu7Yyvxhnpdey65fh.jpg","poster_path":"https://image.tmdb.org/t/p/original/dgbLnnEJIGldXOMt6OWy3X1l0AC.jpg","certification":"N/A","genres":["Comédia","Drama"],"trailer":"N/A"},
