"228968":{"id":"228968","name":"Jogada de Mestre","slug":"jogada-de-mestre","original_title":"Kidnapping Mr. Heineken","overview":"Amsterdã, 1982. Cor (Jim Sturgess), Willem (Sam Worthington), Cat (Ryan Kwanten), Spikes (Mark van Eeuwen) e Brakes (Thomas Cocquerel) são amigos que tentam, de alguma forma, se dar bem na vida. Após fracassarem na tentativa de obter um empréstimo bancário, eles elaboram um plano para sequestrar o milionário Freddy Heineken (Anthony Hopkins) e receber um resgate de US$ 35 milhões. Para tanto o grupo realiza um assalto, de forma a ter a quantia necessária para organizar o cativeiro e todos os detalhes do golpe. Entretanto, após a realização do sequestro, a inevitável tensão decorrente da investigação da polícia faz com que a amizade do grupo, e o próprio golpe, fique por um fio.","first_air_date":"2015-03-12","runtime":95,"episode_run_time":[95],"vote_average":6.0,"created_by":["uMedia","Splendid Film","Informant Europe SPRL","European Film Company","Informant Media"],"production_companies":[{"name":"uMedia"},{"name":"Splendid Film"},{"name":"Informant Europe SPRL"},{"name":"European Film Company"},{"name":"Informant Media"}],"cast":["Anthony Hopkins","Jim Sturgess","Sam Worthington","Ryan Kwanten","Mark van Eeuwen"],"backdrop_path":"https://image.tmdb.org/t/p/original/ngSezgLoXhJmG5786Yq6lelxaTj.jpg","poster_path":"https://image.tmdb.org/t/p/original/5P2DKAHm7vnIffBZQngpXLPVKG5.jpg","certification":"12","genres":["Drama","Ação","Crime","Thriller","Mistério"],"trailer":"N/A"},
"15267":{"id":"15267","name":"A Fera da Guerra","slug":"a-fera-da-guerra","original_title":"The Beast of War","overview":"A União Soviética está bloqueada numa fútil e sangrenta batalha contra as guerrilhas Mujahedeen. Separados de sua patrulha, a equipe do tanque russo T-62 se envolve num jogo mortal de gato e rato com os insurgentes locais, liderados por Taj (Steven Bauer). O tirânico comandante do tanque, Daskal (George Dzudza), espalha destruição em uma pacífica aldeia afegã , levando os valores morais do motorista do tanque, Koverchenko (Jason Patric), ao seu limite máximo. Prevendo um motim, o psicótico Daskal abandona os seus comandados para morrer no deserto nas mãos dos rebeldes e finalmente encontrar-se com seu próprio destino.","first_air_date":"1988-09-14","runtime":111,"episode_run_time":[111],"vote_average":7.0,"created_by":["Brightstar Films"],"production_companies":[{"name":"Brightstar Films"}],"cast":["George Dzundza","Jason Patric","Steven Bauer","Stephen Baldwin","Don Harvey"],"backdrop_path":"https://image.tmdb.org/t/p/original/plUiEahWnvj9a8NbxE356ui5R5W.jpg","poster_path":"https://image.tmdb.org/t/p/original/ux2wud5NtD6A2omfXBta8wxTyRT.jpg","certification":"N/A","genres":["Guerra","Drama"],"trailer":"N/A"},
