"20681":{"id":"20681","name":"Cães de Guerra","slug":"caes-de-guerra","original_title":"The Dogs of War","overview":"O veterano mercenário Shannon é procurado pelo inescrupuloso Endean, representante de um poderoso grupo financeiro internacional. Contratado para liquidar um impiedoso ditador, Shannon, disfarçado de fotógrafo, parte para a capital do pequeno país africano, a fim de estudar as necessidades para cumprir a difícil tarefa a que se propôs. Depois, reúne-se aos amigos mercenários Drew, Derek e Michel para formar o grupo conhecido como \"Os Cães de Guerra\" e depor o ditador do país à bala.","first_air_date":"1980-12-17","runtime":118,"episode_run_time":[118],"vote_average":5.8,"created_by":["Juniper Films","United Artists"],"production_companies":[{"name":"Juniper Films"},{"name":"United Artists"}],"cast":["Christopher Walken","Tom Berenger","Winston Ntshona","Hugh Millais","JoBeth Williams"],"backdrop_path":"https://image.tmdb.org/t/p/original/8KgSYBgPfigVuLaleEQi2YinmEC.jpg","poster_path":"https://image.tmdb.org/t/p/original/hJxPthQXT9TMTgKPWCenbzc1VkE.jpg","certification":"N/A","genres":["Thriller","Ação","Aventura"],"trailer":"N/A"},
