"63710":{"id":"63710","name":"Honey 2: No Ritmo dos Sonhos","slug":"honey-2-no-ritmo-dos-sonhos","original_title":"Honey 2","overview":"Para Maria, viver honestamente significa conviver com a mãe de Honey, Connie (Lonette McKee), e manter um trabalho apenas para sobreviver. Porém, uma rara noite de diversão em um clube de dança local lhe dá a oportunidade de mostrar o que ela tinha quase esquecido: seu talento para dança. Sua habilidade chama a atenção de Brandon (Randy Wayne), um voluntário do Centro Recreativo, que a convida para ajuda-lo a treinar um grupo de bailarinos talentosos, mas indisciplinados, chamado de HD. O talento de Maria também chama a atenção de seu ex-namorado Luis (Christopher ‘War’ Martinez), o carismático líder da premiada equipe de dança 718, que espera atrai-la de volta ao mundo da marginalidade, da qual ela está tentando escapar. Vendo a oportunidade de criar uma nova e significativa vida, Maria se entrega de corpo e alma no mundo da dança e começa a treinara equipe HD para competir no concurso de dança “Dance or Die” – o que significa competir contra o grupo 718 e seu antigo namorado Luis.","first_air_date":"2011-06-23","runtime":110,"episode_run_time":[110],"vote_average":6.3,"created_by":["MFV Productions","Reel Deal Entertainment","Universal Pictures","Marc Platt Productions"],"production_companies":[{"name":"MFV Productions"},{"name":"Reel Deal Entertainment"},{"name":"Universal Pictures"},{"name":"Marc Platt Productions"}],"cast":["Kat Graham","Randy Wayne","Seychelle Gabriel","Audrina Patridge","Brittany Perry-Russell"],"backdrop_path":"https://image.tmdb.org/t/p/original/hZpapggtfwz47XDJqjVek7sAEBh.jpg","poster_path":"https://image.tmdb.org/t/p/original/znKwFYSKYweW4EW7nFYboEbaUtz.jpg","certification":"N/A","genres":["Música","Comédia","Drama"],"trailer":"N/A"},
