"464733":{"id":"464733","name":"Tráfico de Mulheres","slug":"trafico-de-mulheres","original_title":"Trafficked","overview":"Inspirado numa história real. Com lucros acima do obtido pelas maiores empresas do mundo, rendendo centenas de bilhões de dólares anualmente, o tráfico de mulheres escraviza milhares e milhares mundo afora, colocando mulheres inocentes no mundo da prostituição. Inspirado em personagens reais, extraídos do premiado best-seller de Siddharth Kara, este filme retrata a história de três jovens, da América, da Nigéria e da Índia. Depois de serem vítimas de um elaborado esquema internacional de tráfico humano, elas acabam como escravas sexuais em um bordel no Texas. Juntas, elas tentam fugir de seus captores e reclamar sua liberdade!","first_air_date":"2017-10-06","runtime":104,"episode_run_time":[104],"vote_average":6.7,"created_by":[],"production_companies":[],"cast":["Elisabeth Röhm","Ashley Judd","Sean Patrick Flanery","Kelly Washington","Amiah Miller"],"backdrop_path":"https://image.tmdb.org/t/p/original/vye5OeedDJloz6wx58TXdUCO7yO.jpg","poster_path":"https://image.tmdb.org/t/p/original/8aK2J9k73gUw0DcbO6RiCh3vHVE.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
