"36536":{"id":"36536","name":"Onde Está o Garibaldo?","slug":"onde-esta-o-garibaldo","original_title":"Follow That Bird","overview":"A Vila Sésamo é uma rua pacífica e feliz. É lar das criaturas mais divertidas, incluindo Garibaldo, o enorme pássaro amarelo. Toda essa paz e alegria vai acabar para Garibaldo. Ele é despejado e começa uma longa aventura através do país para encontrar seu lugar no mundo. Quando os ex-vizinhos e amigos descobrem a ausência de Garibaldo, eles partem em uma jornada ainda mais louca para trazê-los de volta. Junte-se nesta busca por Garibaldo - e nesta grande diversão - que inclui as participações de Chevy Chase, Sandra Bernhard, John Candy, Waylon Jennings entre outros. Siga o seu coração enquanto Vila Sésamo apresenta \"Onde Está o Garibaldo\".","first_air_date":"1985-08-02","runtime":88,"episode_run_time":[88],"vote_average":6.3,"created_by":["Henson Associates","Warner Bros. Pictures","Children's Television Workshop"],"production_companies":[{"name":"Henson Associates"},{"name":"Warner Bros. Pictures"},{"name":"Children's Television Workshop"}],"cast":["Caroll Spinney","Jim Henson","Frank Oz","Richard Hunt","Kathryn Mullen"],"backdrop_path":"https://image.tmdb.org/t/p/original/5on5xiLXOhBqyphhIxGFYYjKbic.jpg","poster_path":"https://image.tmdb.org/t/p/original/8Ucy9koJwP8BqXBq6SMoRV7hvFf.jpg","certification":"A","genres":["Aventura","Comédia","Família","Música"],"trailer":"N/A"},
"1042650":{"id":"1042650","name":"A Viúva Clicquot – A Mulher que Formou um Império","slug":"a-viuva-clicquot-a-mulher-que-formou-um-imperio","original_title":"Widow Clicquot","overview":"A história de Barbe-Nicole Ponsardin – uma viúva de 27 anos que depois da morte prematura do marido – desrespeita as convenções legais e assume os negócios de vinho que mantinham juntos. Sem apoio, ela passa a conduzir a empresa e a tomar decisões políticas e financeiras desafiando os críticos da época e revolucionando a indústria de Champagne ao se tornar uma das primeiras empresárias do ramo no mundo. Hoje, com 250 anos de história, a marca Veuve Clicquot é uma das mais reconhecidas e premiadas do setor.","first_air_date":"2024-07-18","runtime":91,"episode_run_time":[91],"vote_average":6.6,"created_by":["Fourth & Twenty Eight Films"],"production_companies":[{"name":"Fourth & Twenty Eight Films"}],"cast":["Haley Bennett","Tom Sturridge","Sam Riley","Leo Suter","Ben Miles"],"backdrop_path":"https://image.tmdb.org/t/p/original/f8jMUMOGqfbiLYrBzlmM4uxesRf.jpg","poster_path":"https://image.tmdb.org/t/p/original/iwhEYKNctfAMMImyehKFjK5ULCD.jpg","certification":"14","genres":["Drama"],"trailer":"53tY4NQQkqI"},
