"510298":{"id":"510298","name":"Seberg Contra Todos","slug":"seberg-contra-todos","original_title":"Seberg","overview":"Paris, 1968. A atriz Jean Seberg (Kristen Stewart) está no auge de sua popularidade, graças ao sucesso de vários filmes rodados na França. Ao chegar aos Estados Unidos ela logo se envolve com o ativista de direitos civis Hakim Jamal (Anthony Mackie), que conheceu ainda durante o voo. Jean logo se posiciona a favor dos Panteras Negras e passa a ser uma das financiadoras do movimento, ao mesmo tempo em que mantém um caso com Hakim. Tal situação é acompanhada de perto peo FBI, que mantinha um programa de vigilância para romper e expor os Panteras Negras. Dentre os agentes designados para espioná-la está Jack Solomon (Jack O'Connell), que começa a se rebelar quando o FBI inicia um plano de difamação contra a atriz.","first_air_date":"2019-12-13","runtime":102,"episode_run_time":[102],"vote_average":5.9,"created_by":["Automatik Entertainment","Ingenious Media","Bradley Pilz Productions"],"production_companies":[{"name":"Automatik Entertainment"},{"name":"Ingenious Media"},{"name":"Bradley Pilz Productions"}],"cast":["Kristen Stewart","Jack O'Connell","Anthony Mackie","Margaret Qualley","Zazie Beetz"],"backdrop_path":"https://image.tmdb.org/t/p/original/cdMfn0Jr9RGqKkaX9HyR5l1kiYy.jpg","poster_path":"https://image.tmdb.org/t/p/original/1yxef9PA6WRYqpQjKxbst7BKdzW.jpg","certification":"14","genres":["Thriller","Drama"],"trailer":"mUUsDIwu3hU"},
"581361":{"id":"581361","name":"Badla","slug":"badla","original_title":"बदला","overview":"Uma jovem empresária de sucesso encontra-se trancada em um quarto de hotel com o cadáver de seu amante morto. Ela contrata um advogado de prestígio para defendê-la e eles trabalham juntos para descobrir o que realmente aconteceu. Quanto mais eles tentam desvendar a verdade, mais obscura a situação fica.","first_air_date":"2019-03-08","runtime":1,"episode_run_time":[1],"vote_average":7.3,"created_by":["Azure Entertainment","Red Chillies Entertainment","Universal Media"],"production_companies":[{"name":"Azure Entertainment"},{"name":"Red Chillies Entertainment"},{"name":"Universal Media"}],"cast":["Amitabh Bachchan","Taapsee Pannu","Tony Luke","Amrita Singh","Manav Kaul"],"backdrop_path":"https://image.tmdb.org/t/p/original/okhoiuVn0GpmlreE6wuHR7qTRby.jpg","poster_path":"https://image.tmdb.org/t/p/original/eKpzbERuhogYTwI3PwfVsAHXnuO.jpg","certification":"14","genres":["Crime","Thriller","Mistério","Drama"],"trailer":"N/A"},
"152780":{"id":"152780","name":"O Passado","slug":"o-passado","original_title":"Le passé","overview":"Este drama mostra a ruína da relação entre um marido iraniano e sua esposa francesa, vivendo na Europa. Após muitas disputas, ele abandona a família e os dois filhos para retornar ao seu país de origem. Quando a esposa pede o divórcio oficial, ele descobre que o pedido é motivado pelo fato de ela ter conhecido outro homem. Assim, sem demoras, ele retorna ao lar para confrontar a esposa e o novo pretendente dela.","first_air_date":"2013-05-17","runtime":130,"episode_run_time":[130],"vote_average":7.3,"created_by":["Memento Films Production","France 3 Cinéma","BIM Productions","Canal+","Ciné+","France Télévisions","MEDIA Programme of the European Union","Eurimages","Memento Films International"],"production_companies":[{"name":"Memento Films Production"},{"name":"France 3 Cinéma"},{"name":"BIM Productions"},{"name":"Canal+"},{"name":"Ciné+"},{"name":"France Télévisions"},{"name":"MEDIA Programme of the European Union"},{"name":"Eurimages"},{"name":"Memento Films International"}],"cast":["Bérénice Bejo","Ali Mosaffa","Tahar Rahim","Pauline Burlet","Elyes Aguis"],"backdrop_path":"https://image.tmdb.org/t/p/original/1KUQMhODF1W1h1f9MZKVxy1S3Hu.jpg","poster_path":"https://image.tmdb.org/t/p/original/i7ASgbGMBm6t8gIwXf7mOUGjvRm.jpg","certification":"N/A","genres":["Drama","Mistério"],"trailer":"tjfdvnzh4ow"},
"60405":{"id":"60405","name":"A Fabulosa Aventura da Sharpay","slug":"a-fabulosa-aventura-da-sharpay","original_title":"Sharpay's Fabulous Adventure","overview":"Um olheiro vê Sharpay Evans e seu cachorro Boi se apresentando em um evento de caridade e os envia à cidade de Nova York. Sharpay achava que fama e fortuna são fáceis de conquistar, mas descobre que o meio artístico é um mundo de cobra comendo cobra e se decepciona. Ela conhece Peyton, um charmoso estudante de cinema, que a ajuda a lidar com uma manipuladora estrela da Broadway e alcançar o sucesso.","first_air_date":"2011-04-19","runtime":89,"episode_run_time":[89],"vote_average":6.0,"created_by":["Princessa Productions","Borden & Rosenbush Entertainment"],"production_companies":[{"name":"Princessa Productions"},{"name":"Borden & Rosenbush Entertainment"}],"cast":["Ashley Tisdale","Austin Butler","Cameron Goodman","Bradley Steven Perry","Lucas Grabeel"],"backdrop_path":"https://image.tmdb.org/t/p/original/zIxWFekMJkxUFp52xAWSP0mhB8k.jpg","poster_path":"https://image.tmdb.org/t/p/original/rwZe91BYGQLVhQ1opbKwRf1hQV5.jpg","certification":"N/A","genres":["Família","Música"],"trailer":"N/A"},
