"20277":{"id":"20277","name":"Um Amor de Companheiro","slug":"um-amor-de-companheiro","original_title":"The Ugly Dachshund","overview":"Fran Garrison está completamente elétrica porque sua preciosa Dachshund, Danke, terá filhotes, e ela espera que um deles se torne um campeão. Mas numa ida ao veterinário, seu marido Jim é convencido a deixar Danke a adotar um filhote da raça Great Dane que foi abandonado pela mãe. Mas Brutus tem um problema: ele pensa ser um dachshund e é grande demais para ser um cãozinho de colo. Mas quando Fran passa a ridicularizar Brutus, Jim prepara um plano para provar a todos (e a Fran) que um great dane pode ser muito mais do que um dachshund feioso.","first_air_date":"1966-02-16","runtime":93,"episode_run_time":[93],"vote_average":6.6,"created_by":["Walt Disney Productions"],"production_companies":[{"name":"Walt Disney Productions"}],"cast":["Dean Jones","Suzanne Pleshette","Charles Ruggles","Kelly Thordsen","Parley Baer"],"backdrop_path":"https://image.tmdb.org/t/p/original/mxUBaup8dAcgqGtfKFa7VkBccAX.jpg","poster_path":"https://image.tmdb.org/t/p/original/1WmKES9yTthsIoA6AO5wXoCYDai.jpg","certification":"N/A","genres":["Comédia","Drama","Família"],"trailer":"N/A"},
"75900":{"id":"75900","name":"Sete Dias com Marilyn","slug":"sete-dias-com-marilyn","original_title":"My Week with Marilyn","overview":"A musa Marilyn Monroe (Michelle Williams) está em Londres pela primeira vez para filmar “O Príncipe Encantado” ao lado de Laurence Olivier (Kenneth Branagh). A história adapta o livro homônimo de Colin Clark, que na época trabalhava como assistente nas filmagens. Durante uma semana, ele teve a oportunidade de ciceronear a diva - desesperada para escapar das pressões da rotina hollywoodiana - e mostrar-lhe o melhor da vida britânica.","first_air_date":"2011-11-23","runtime":99,"episode_run_time":[99],"vote_average":6.7,"created_by":["The Weinstein Company","BBC Film","Trademark Films","Lipsync Productions"],"production_companies":[{"name":"The Weinstein Company"},{"name":"BBC Film"},{"name":"Trademark Films"},{"name":"Lipsync Productions"}],"cast":["Michelle Williams","Kenneth Branagh","Eddie Redmayne","Dominic Cooper","Philip Jackson"],"backdrop_path":"https://image.tmdb.org/t/p/original/2dBxPyGT9wliH8xa2GIOvK7OKj5.jpg","poster_path":"https://image.tmdb.org/t/p/original/7vvAhcIab1tMLIuHeDQzpZZawx3.jpg","certification":"12","genres":["Drama","Romance"],"trailer":"N/A"},
