"12518":{"id":"12518","name":"Lua-de-Mel a Três","slug":"lua-de-mel-a-tres","original_title":"Honeymoon in Vegas","overview":"Jack Singer (Nicolas Cage) é um detetive que está apaixonado por sua namorada (Sarah Jessica Parker), mas por causa da sua mãe (Anne Bancroft) morre de medo de se casar. Ella porém o encosta na parede, pressionando-o para viajarem para Las Vegas para casar. No entanto, horas antes do casamento o noivo é convidado para um jogo de pôquer e perde muito dinheiro. Como não pode pagar seu oponente (James Caan), ele concorda em receber a noiva \"emprestada\" no fim-de-semana como pagamento.","first_air_date":"1992-08-28","runtime":96,"episode_run_time":[96],"vote_average":5.6,"created_by":["New Line Cinema","Castle Rock Entertainment","Columbia Pictures"],"production_companies":[{"name":"New Line Cinema"},{"name":"Castle Rock Entertainment"},{"name":"Columbia Pictures"}],"cast":["Nicolas Cage","Sarah Jessica Parker","James Caan","Pat Morita","Johnny Williams"],"backdrop_path":"https://image.tmdb.org/t/p/original/ndkyB3JC1egoaIc0QKq4t6rn9p6.jpg","poster_path":"https://image.tmdb.org/t/p/original/9wlE3DYWV3FugLpgtCxTJJ4urJr.jpg","certification":"14","genres":["Comédia","Romance"],"trailer":"N/A"},
