"100544":{"id":"100544","name":"Rastros da Violência","slug":"rastros-da-violencia","original_title":"Officer Down","overview":"Faz um ano que o policial corrupto David Callahan (Stephen Dorff) foi baleado em uma operação anti-drogas que falhou e, foi salvo por um estranho que lhe deu uma segunda chance de limpar seu nome. Porém, quando este mesmo estranho ressurge, procurando vingar-se dos responsáveis por uns ataques contra jovens em um clube, Callahan deve encontrá-lo para garantir que seus segredos do passado não venham à tona. Agora, o desespero para manter escondidas as sujeiras que cometeu acabam o levando a uma trilha de mentiras.","first_air_date":"2013-01-22","runtime":98,"episode_run_time":[98],"vote_average":5.3,"created_by":["Jeff Most Productions"],"production_companies":[{"name":"Jeff Most Productions"}],"cast":["Stephen Dorff","AnnaLynne McCord","David Boreanaz","Stephen Lang","Dominic Purcell"],"backdrop_path":"https://image.tmdb.org/t/p/original/lXV99D0vbh6h13sL5L18tKrpjLo.jpg","poster_path":"https://image.tmdb.org/t/p/original/zlj2aTbNi0eNXyPeQ5NxpjROBYI.jpg","certification":"N/A","genres":["Crime","Drama"],"trailer":"N/A"},
