"40001":{"id":"40001","name":"Amor Por Acidente","slug":"amor-por-acidente","original_title":"Mrs. Winterbourne","overview":"A vencedora do Oscar, Shirley MacLaine (Laços de Ternura, 1984), Ricki Lake e Brandan Fraser estrelam esta agitada comédia romântica sobre uma garota que encontra seu verdadeiro amor, mas primeiro precisa resolver um pequeno engano sobre sua verdadeira identidade. Por obra do destino, Connie Doyle é confundida como a viúva do filho de uma milionária. Sem ter para onde ir, sem dinheiro e grávida, Connie aceita a generosidade da entristecida mãe do falecido rapaz e acaba se apaixonando pelo irmão de seu falecido marido. \"MacLaine está perfeita como a fada madrinha desta história de Cinderela. Absolutamente irresistível.\" - Ron Birwingan.","first_air_date":"1996-04-19","runtime":105,"episode_run_time":[105],"vote_average":7.2,"created_by":["TriStar Pictures"],"production_companies":[{"name":"TriStar Pictures"}],"cast":["Shirley MacLaine","Ricki Lake","Brendan Fraser","Miguel Sandoval","Loren Dean"],"backdrop_path":"https://image.tmdb.org/t/p/original/2peKSpj2WqR5QxHqS1xzrwkRfNd.jpg","poster_path":"https://image.tmdb.org/t/p/original/4tWo1V9UWnwQz5fNOjxAA4bbuJW.jpg","certification":"N/A","genres":["Romance","Drama"],"trailer":"N/A"},
"9749":{"id":"9749","name":"Assassinato por Encomenda","slug":"assassinato-por-encomenda","original_title":"Fletch","overview":"O repórter investigativo Irwin \"Fletch\" Fletcher leva o seu editor à loucura, mas sempre produz ótimas reportagens. Quando sua próxima história é sobre o tráfico de drogas na praia, Fletch se disfarça como um homem de rua. Sem saber da verdadeira identidade, o empresário Alan Stanwyk oferece Fletch cinquenta mil dólares para matá-lo. Intrigado, Fletch decide descobrir toda a história por trás dessa oferta.","first_air_date":"1985-05-31","runtime":98,"episode_run_time":[98],"vote_average":6.7,"created_by":["Universal Pictures"],"production_companies":[{"name":"Universal Pictures"}],"cast":["Chevy Chase","Tim Matheson","Dana Wheeler-Nicholson","Joe Don Baker","Richard Libertini"],"backdrop_path":"https://image.tmdb.org/t/p/original/caRqs1GIhwoJqn8JA3LakIUR0v3.jpg","poster_path":"https://image.tmdb.org/t/p/original/ejiHSIlivEUaeTAAq9mxQvxl6Sl.jpg","certification":"N/A","genres":["Comédia","Crime","Mistério"],"trailer":"N/A"},
"65796":{"id":"65796","name":"Wild Bill - Uma Lenda No Oeste","slug":"wild-bill-uma-lenda-no-oeste","original_title":"Wild Bill","overview":"Ele era uma lenda em seu tempo... e será para sempre. Jeff Bridges interpreta Wild Bill Hickok, o pistoleiro beberrão, rápido no gatilho, que vivia sempre em perigo. A incrível história de Hickok é contada em magnífico estilo e rápido desenrolar, demonstrando a personalidade de um dos mais interessantes heróis do Oeste americano. Wild Bill - Uma Lenda no Oeste é uma \"obra de arte do cinema de ação\" (Paul Wunder,WBAI Radio). Na cidade de Deadwood, South Dakota,Wild Bill precisa enfrentar seu inimigo mais mortal. Um misterioso estrangeiro (David Arquette) chegou à cidade anunciando que não irá embora até que Hickok esteja morto. Wild Bill encontra abrigo nos braços da sensual Calamity Jane (Ellen Barkin), mas é perseguido pela memória da única mulher a quem ele verdadeiramente amou, uma saudade que pode custar sua vida. À medida que Hickok e seu adversário se aproximam do confronto decisivo, o cenário está pronto para um clímax intenso, dramático e excitante.","first_air_date":"1995-12-01","runtime":98,"episode_run_time":[98],"vote_average":5.7,"created_by":["United Artists","The Zanuck Company","Metro-Goldwyn-Mayer"],"production_companies":[{"name":"United Artists"},{"name":"The Zanuck Company"},{"name":"Metro-Goldwyn-Mayer"}],"cast":["Jeff Bridges","Ellen Barkin","John Hurt","Diane Lane","Keith Carradine"],"backdrop_path":"https://image.tmdb.org/t/p/original/yo8EUyqcVsrJbhUkvc3FCu3R8tl.jpg","poster_path":"https://image.tmdb.org/t/p/original/4OkVImn4c5CyX7TEtql7kAfuAZM.jpg","certification":"N/A","genres":["Faroeste","Ação","Drama","História"],"trailer":"N/A"},
