"390433":{"id":"390433","name":"Esperando por Você","slug":"esperando-por-voce","original_title":"널 기다리며","overview":"Quando Hee-Joo (Shim Eun-Kyung) tinha 7 anos, seu pai foi assassinado. Seu pai era detetive e estava trabalhando em um caso de serial killer. O assassino, Ki-Bum (Kim Sung-Oh), foi preso, mas considerado culpado por apenas um assassinato. 15 anos depois, Ki-Bum é libertado da prisão. O detetive Dae-Young (Yoon Je-Moon) trabalhou no caso original com o pai de Hee-Joo e ele não desistiu de ter uma condenação por assassinato para seu ex-sócio. Enquanto isso, Hee-Joo esperou pacientemente pela libertação de Ki-Bum.","first_air_date":"2016-03-10","runtime":108,"episode_run_time":[108],"vote_average":7.2,"created_by":["Soojak Film","모티브랩","Next Entertainment World","DCG Plus"],"production_companies":[{"name":"Soojak Film"},{"name":"모티브랩"},{"name":"Next Entertainment World"},{"name":"DCG Plus"}],"cast":["심은경","김성오","윤제문","오태경","정해균"],"backdrop_path":"https://image.tmdb.org/t/p/original/1liJMvtf2nWZl9BBQiAhcIXrk5R.jpg","poster_path":"https://image.tmdb.org/t/p/original/uBluwU54W9XTmhMFBWsXupkpbjv.jpg","certification":"N/A","genres":["Crime","Thriller"],"trailer":"N/A"},
"4923":{"id":"4923","name":"Zardoz","slug":"zardoz","original_title":"Zardoz","overview":"Sean Connery apresenta uma interpretação poderosa nesta fantástica visão de um mundo futuro dividido em duas sociedades. O Vortex é uma luxuriante e exclusiva comunidade, formada por cientistas e intelectuais imortais completamente preservada do contato com o mundo exterior. Do lado de fora do Vortex, existe um mundo desolado arrasado pela guerra e poluição, povoado pelos Brutos, selvagens primitivos e assassinos que adoram um deus aterrorizante, Zardoz. Mas um bruto rebelde (Sean Connery) está decidido a sobreviver seguindo suas próprias leis, que podem ameaçar o equilíbrio da civilização e... possivelmente destruí-la.","first_air_date":"1974-02-06","runtime":105,"episode_run_time":[105],"vote_average":5.9,"created_by":["John Boorman Productions"],"production_companies":[{"name":"John Boorman Productions"}],"cast":["Sean Connery","Charlotte Rampling","Sara Kestelman","John Alderton","Sally Anne Newton"],"backdrop_path":"https://image.tmdb.org/t/p/original/xP91Ux8P3dCeSHbPZHRSLTpemxF.jpg","poster_path":"https://image.tmdb.org/t/p/original/6qvQhJhvM7wWPB2LjVpivSNraIv.jpg","certification":"N/A","genres":["Fantasia","Ação","Thriller","Ficção científica"],"trailer":"N/A"},
"33078":{"id":"33078","name":"Zoo - Um Z e Dois Zeros","slug":"zoo-um-z-e-dois-zeros","original_title":"A Zed & Two Noughts","overview":"Um carro colide com um cisne do lado de fora do zoológico de Roterdã. Duas passageiras morrem e a motorista, Alma, tem sua perna amputada. Obcecados pelo acidente, os maridos das mulheres mortas – gêmeos – iniciam um estranho caso com Alma.","first_air_date":"1985-10-04","runtime":117,"episode_run_time":[117],"vote_average":7.0,"created_by":["BFI","Artificial Eye","Allarts Enterprises","Film4 Productions","VPRO"],"production_companies":[{"name":"BFI"},{"name":"Artificial Eye"},{"name":"Allarts Enterprises"},{"name":"Film4 Productions"},{"name":"VPRO"}],"cast":["Frances Barber","Joss Ackland","Brian Deacon","Geoffrey Palmer","Eric Deacon"],"backdrop_path":"https://image.tmdb.org/t/p/original/qd5DXGVLzI8lUZUs59ePSyzU0Z0.jpg","poster_path":"https://image.tmdb.org/t/p/original/7nyF9rccCMeJRIBVAFaah8Gcc9e.jpg","certification":"N/A","genres":["Comédia","Drama"],"trailer":"N/A"},
"111473":{"id":"111473","name":"O Nosso Segredo","slug":"o-nosso-segredo","original_title":"The Invisible Woman","overview":"Nelly é assombrada por seu passado. Suas lembranças nos levam de volta no tempo para acompanhar a história de seu relacionamento com Charles Dickens, com quem ela descobriu uma cumplicidade emocionante, mas frágil. Dickens — famoso, controlador e emocionalmente isolado dentro de seu sucesso — se apaixona por Nelly. Conforme Nelly torna-se o foco da paixão de Dickens e sua musa, o preço para ambos é o segredo, e para Nelly, uma vida de \"invisibilidade\".","first_air_date":"2013-12-25","runtime":111,"episode_run_time":[111],"vote_average":5.9,"created_by":["BBC Film","Headline Pictures","Magnolia Mae Films"],"production_companies":[{"name":"BBC Film"},{"name":"Headline Pictures"},{"name":"Magnolia Mae Films"}],"cast":["Ralph Fiennes","Felicity Jones","Joanna Scanlan","Kristin Scott Thomas","Tom Hollander"],"backdrop_path":"https://image.tmdb.org/t/p/original/3CXIH1cc3Da9Ubk5Xgzqh5a88QS.jpg","poster_path":"https://image.tmdb.org/t/p/original/qKpBUrzRjHS08jiXbdaJpXwth06.jpg","certification":"N/A","genres":["Drama","História","Romance"],"trailer":"N/A"},
