"99770":{"id":"99770","name":"Astérix e Obélix: A Serviço de sua Majestade","slug":"asterix-e-obelix-a-servico-de-sua-majestade","original_title":"Astérix & Obélix : Au service de Sa Majesté","overview":"Asterix e Obelix voltam em uma nova aventura. 50 anos A.C. Júlio César tem um enorme desejo de conquista e a frente de suas legiões gloriosas, ele decide invadir a Grã-Bretanha, e em pouco tempo domina todo o território, faltando apenas a pequena aldeia de Breton. Seu povo resiste bravamente, mas vai enfraquecendo e eles, então, decidem buscar a ajuda de Asterix, Obelix e seu barril de poção mágica.","first_air_date":"2012-10-17","runtime":110,"episode_run_time":[110],"vote_average":5.1,"created_by":["Fidélité Films","Cinetotal","Lucky Red","Morena Films","Saint Sébastien Froissart","France 2 Cinéma","France 3 Cinéma"],"production_companies":[{"name":"Fidélité Films"},{"name":"Cinetotal"},{"name":"Lucky Red"},{"name":"Morena Films"},{"name":"Saint Sébastien Froissart"},{"name":"France 2 Cinéma"},{"name":"France 3 Cinéma"}],"cast":["Édouard Baer","Gérard Depardieu","Guillaume Gallienne","Vincent Lacoste","Valérie Lemercier"],"backdrop_path":"https://image.tmdb.org/t/p/original/wVyHzMadmXs5FsQWnRjg3oGTIjY.jpg","poster_path":"https://image.tmdb.org/t/p/original/dXSvRYyY2SzMVP0uA9fjEIacvLD.jpg","certification":"N/A","genres":["Família","Aventura","Comédia"],"trailer":"N/A"},
