"67748":{"id":"67748","name":"Os Crimes de Snowtown","slug":"os-crimes-de-snowtown","original_title":"Snowtown","overview":"Jamie Vlassakis (Lucas Pittaway) é um jovem de 16 anos que vive com sua mãe Elizabeth Harvey (Louise Harris) e seus dois irmãos em um bairro suburbano violento da Austrália. Certo dia, John Bunting (Daniel Henshall) muda para a casa do outro lado da rua. Carismático, Bunting envolve-se com a mãe de Jamie e passa a fazer parte da família. O novo vizinho também promove reuniões, nas quais mobiliza um pequeno grupo com suas crenças na autojustiça e na manutenção da ordem. Jamie torna-se seu protegido e vê nele a figura do pai que nunca teve. Até que, aos poucos, a outra face do mentor começa a se relevar. Baseado na história real de um famoso serial killer da Austrália.","first_air_date":"2011-05-19","runtime":120,"episode_run_time":[120],"vote_average":6.3,"created_by":["Screen Australia","Warp Films","Carver Films"],"production_companies":[{"name":"Screen Australia"},{"name":"Warp Films"},{"name":"Carver Films"}],"cast":["Lucas Pittaway","Daniel Henshall","Louise Harris","Frank Cwertniak","Matthew Howard"],"backdrop_path":"https://image.tmdb.org/t/p/original/xm9iW6Y9hHTtFTq5qtUrsS0JpqI.jpg","poster_path":"https://image.tmdb.org/t/p/original/nzqtXzLLW0F339SOf9vkKy1I9p7.jpg","certification":"N/A","genres":["Crime","Drama"],"trailer":"N/A"},
