"641370":{"id":"641370","name":"Invasão ao Planeta Terra","slug":"invasao-ao-planeta-terra","original_title":"Invasion: Planet Earth","overview":"A raça humana enfrenta seu maior desafio quando alienígenas que se escondiam no céu iniciam uma invasão à Terra. Em meio a um mundo tomado pelo caos, os extraterrestres assumem o controle do planeta na tentativa de encontrar o garoto Cameron, o único entre os sete bilhões de humanos que, mesmo sem saber, detém o poder de destruí-los.","first_air_date":"2019-12-05","runtime":96,"episode_run_time":[96],"vote_average":5.2,"created_by":["AlphaStar Productions","CMCV Studios"],"production_companies":[{"name":"AlphaStar Productions"},{"name":"CMCV Studios"}],"cast":["Simon Haycock","Lucy Drive","Julie Hoult","Danny Steele","Sophie Anderson"],"backdrop_path":"https://image.tmdb.org/t/p/original/A805E3bj8RcZvgQOiTuFMiUHiYq.jpg","poster_path":"https://image.tmdb.org/t/p/original/mOcn5sJY6SVFAaLDeLKN90oYrCz.jpg","certification":"12","genres":["Ação","Aventura","Ficção científica"],"trailer":"N/A"},
"24961":{"id":"24961","name":"O Mágico Inesquecível","slug":"o-magico-inesquecivel","original_title":"The Wiz","overview":"No Harlem, Dorothy, uma professora, tenta salvar seu cachorro de uma tempestade e acaba, misteriosamente, levada para um mundo mágico chamado Oz. Depois de acidentalmente matar a Bruxa Malvada do Leste em sua chegada, Dorothy toma conhecimento de um mago que pode ajudá-la a voltar para Manhattan. Enquanto Dorothy sai a procura dele, ela encontra um espantalho, um homem de lata e um leão.","first_air_date":"1978-10-24","runtime":134,"episode_run_time":[134],"vote_average":6.0,"created_by":["Universal Pictures","Motown Productions"],"production_companies":[{"name":"Universal Pictures"},{"name":"Motown Productions"}],"cast":["Diana Ross","Michael Jackson","Nipsey Russell","Ted Ross","Theresa Merritt"],"backdrop_path":"https://image.tmdb.org/t/p/original/w94RZ1drihdy91hSVd4Fr69BZV0.jpg","poster_path":"https://image.tmdb.org/t/p/original/gELIBvGrkeBjdGe0pxNosc7WXuz.jpg","certification":"N/A","genres":["Música","Fantasia","Aventura"],"trailer":"N/A"},
"865559":{"id":"865559","name":"No Seu Natal ou no Meu","slug":"no-seu-natal-ou-no-meu","original_title":"Your Christmas or Mine?","overview":"É véspera de véspera de Natal. Depois de se despedirem na estação de comboios de Marylebone, Hayley e James, percebem que não conseguem passar o Natal afastados. Tomam a mesma decisão impulsiva de surpreender o outro e, sem saberem, cruzam-se na estação e trocam de comboio por engano. Começa a nevar e eles percebem que vão ter de passar o Natal com a família da cara-metade. Irá o amor sobreviver?","first_air_date":"2022-12-02","runtime":94,"episode_run_time":[94],"vote_average":6.4,"created_by":["Shiny Button Productions","Banijay Entertainment"],"production_companies":[{"name":"Shiny Button Productions"},{"name":"Banijay Entertainment"}],"cast":["Asa Butterfield","Cora Kirk","Angela Griffin","Daniel Mays","Harriet Walter"],"backdrop_path":"https://image.tmdb.org/t/p/original/pZxSWMjfjSSujRVj8xk8YlIZKoX.jpg","poster_path":"https://image.tmdb.org/t/p/original/A806wuTGJECDh9krhQAhnieQcLr.jpg","certification":"N/A","genres":["Romance","Comédia"],"trailer":"N/A"},
