"49367":{"id":"49367","name":"2 Filhos de Francisco: A História de Zezé di Camargo & Luciano","slug":"2-filhos-de-francisco-a-historia-de-zeze-di-camargo-luciano","original_title":"2 Filhos de Francisco: A História de Zezé di Camargo & Luciano","overview":"Francisco Camargo é um lavrador de Pirenópolis, no interior de Goiás, que tem um sonho aparentemente impossível: transformar dois de seus nove filhos em uma dupla sertaneja. Ele inicialmente deposita sua esperança no mais velho, Mirosmar, e resolve lhe dar um acordeão quando o menino completa onze anos. Mirosmar e seu irmão Emival, que toca violão, fazem sucesso nas festas da vila onde moram (Capela do Rio do Peixe, distrito de Pirenópolis), mas devido à perda da propriedade onde moravam nos anos 70, toda a família é obrigada a se mudar para Goiânia.","first_air_date":"2005-08-19","runtime":118,"episode_run_time":[118],"vote_average":6.8,"created_by":["ZCL Produções Artísticas","Columbia TriStar Filmes do Brasil","Conspiração Filmes","Globo Filmes"],"production_companies":[{"name":"ZCL Produções Artísticas"},{"name":"Columbia TriStar Filmes do Brasil"},{"name":"Conspiração Filmes"},{"name":"Globo Filmes"}],"cast":["Ângelo Antônio","Dira Paes","Dablio Moreira","Marcos Henrique","Márcio Kieling"],"backdrop_path":"https://image.tmdb.org/t/p/original/fzGvBBXOKmSCMTvaUdRkrf9A5kk.jpg","poster_path":"https://image.tmdb.org/t/p/original/ub8vYfI1zgW4WItWDQ5mT6q5tzQ.jpg","certification":"L","genres":["Drama","História","Música"],"trailer":"N/A"},
"17745":{"id":"17745","name":"Férias em Alto Astral","slug":"ferias-em-alto-astral","original_title":"Camp Nowhere","overview":"Morris (Jonathan Jackson) e seus amigos são jovens que não aguentam mais ser obrigados pelos seus pais a passar o verão em acampamentos chatos. Então, eles decidem criar seu próprio acampamento, sem professores, funcionários ou regras. Eles chantageiam o professor de teatro Dennis Van Welker (Christopher Lloyd) para ajudá-los nesta louca missão e convencer seus pais de que é proibido visitas no local, deixando o caminho liberado para que eles tenham o melhor verão de suas vidas.","first_air_date":"1994-08-26","runtime":96,"episode_run_time":[96],"vote_average":5.9,"created_by":["Hollywood Pictures"],"production_companies":[{"name":"Hollywood Pictures"}],"cast":["Jonathan Jackson","Andrew Keegan","Marnette Patterson","Melody Kay","Christopher Lloyd"],"backdrop_path":"https://image.tmdb.org/t/p/original/hUqpbtSns4usIVA1vhclCYj0lDu.jpg","poster_path":"https://image.tmdb.org/t/p/original/ge1zHTR2UdYbhsb7Cryg7GqdfUJ.jpg","certification":"N/A","genres":["Comédia","Drama","Família"],"trailer":"N/A"},
