"16162":{"id":"16162","name":"Amigos Indiscretos","slug":"amigos-indiscretos","original_title":"The Best Man","overview":"Harper Stewart é um esforçado e tímido escritor e também é o padrinho do casamento de Lance e Mia. Infelizmente para Harper, o momento não podia ser pior. Seu novo livro está saindo contando as histórias que passou com seus amigos na faculdade. E a festa de casamento reúne os os colegas de escola Quentin, Mirch e Jordan. Com a celebração começam a ser revelados escandalosos segredos dos amigos.","first_air_date":"1999-10-22","runtime":120,"episode_run_time":[120],"vote_average":6.7,"created_by":["Universal Pictures","40 Acres and a Mule Filmworks"],"production_companies":[{"name":"Universal Pictures"},{"name":"40 Acres and a Mule Filmworks"}],"cast":["Taye Diggs","Morris Chestnut","Nia Long","Harold Perrineau","Terrence Howard"],"backdrop_path":"https://image.tmdb.org/t/p/original/rptszjb9Cgx7hUXTxTmlh4ScD7m.jpg","poster_path":"https://image.tmdb.org/t/p/original/ub2Njdn4kq49ndyg7QglnE8PUqT.jpg","certification":"16 anos","genres":["Drama","Comédia"],"trailer":"N/A"},
