"583268":{"id":"583268","name":"Encontros","slug":"encontros","original_title":"Deux moi","overview":"Rémi e Mélanie têm em torno de 30 anos e, apesar de morarem em prédios um ao lado do outro, não se conhecem. Ambos estão solteiros e enfrentam problemas pessoais: ele, devido à demissão de praticamente todos de seu antigo trabalho enquanto foi promovido para outro setor, ela sem conseguir superar o término de um longo relacionamento, cujo fim já tem um ano. Cada um à sua maneira, os dois buscam meios de lidar com o momento depressivo através das redes sociais: ele pelo Facebook, ela através do Tinder.","first_air_date":"2019-09-11","runtime":110,"episode_run_time":[110],"vote_average":6.4,"created_by":["Ce qui me meut","StudioCanal","France 2 Cinéma","Panache Productions","Proximus","Move Movie","La Compagnie Cinématographique"],"production_companies":[{"name":"Ce qui me meut"},{"name":"StudioCanal"},{"name":"France 2 Cinéma"},{"name":"Panache Productions"},{"name":"Proximus"},{"name":"Move Movie"},{"name":"La Compagnie Cinématographique"}],"cast":["François Civil","Ana Girardot","Camille Cottin","François Berléand","Simon Abkarian"],"backdrop_path":"https://image.tmdb.org/t/p/original/vMgpILNM1lMfGgYlNrQUF67fU9x.jpg","poster_path":"https://image.tmdb.org/t/p/original/sPiIuaRtCUee5lpYa11OtZjpjwU.jpg","certification":"N/A","genres":["Drama","Romance","Comédia"],"trailer":"kiu3PvNiT_I"},
