"13160":{"id":"13160","name":"Nem por Cima do Meu Cadáver","slug":"nem-por-cima-do-meu-cadaver","original_title":"Over Her Dead Body","overview":"Henry(Paul Rudd)fica arrasado quando a noiva Kate(Eva Longoria Parker)morre exatamente no dia em que eles iriam se casar. Mesmo que relutante, Henry concorda com a irmã Chloe (Lindsay Sloane) em consultar uma médium espiritual chamada Ashley (Lake Bell). A idéia, claro, é que ele possa ser ajudado a compreender os mistérios da morte. Mas ele se mantém cético como sempre, até que uma coisa acontece. Henry começa a se apaixonar por Ashley, e ela corresponde. Problema: Ashley passa a ser assombrada pelo espírito de Kate, para quem romper o relacionamento dos dois seria sua última missão na Terra.","first_air_date":"2008-02-01","runtime":95,"episode_run_time":[95],"vote_average":5.5,"created_by":["Gold Circle Films","The Safran Company","New Line Cinema"],"production_companies":[{"name":"Gold Circle Films"},{"name":"The Safran Company"},{"name":"New Line Cinema"}],"cast":["Eva Longoria","Paul Rudd","Lake Bell","Jason Biggs","Lindsay Sloane"],"backdrop_path":"https://image.tmdb.org/t/p/original/xyE226IdU7ydSb1MxhsVPAqHr61.jpg","poster_path":"https://image.tmdb.org/t/p/original/ugO8SQQTFcpRjQeof9C1DsBKHMz.jpg","certification":"N/A","genres":["Comédia"],"trailer":"N/A"},
