"2058":{"id":"2058","name":"A Lente do Amor","slug":"a-lente-do-amor","original_title":"Addicted to Love","overview":"Sam (Matthew Broderick, de Curtindo a Vida Adoidado) é um romântico do interior, apaixonado pela jovem Lina (Kelly Preston, de Jerry Maguire). Maggie (Meg Ryan, de Sintonia de Amor) é fotógrafa em Nova York e não acredita mais no amor por causa de seu ex-noivo Anton (Tcheky Karyo). Duas vidas completamente opostas que o destino uniu por uma estranha coincidência: ambos foram abandonados pelas pessoas que amavam... E agora, Linda e Anton moram juntos e estão apaixonados! Maggie quer vingança a qualquer custo e só precisa convencer Sam a ajudá-la. Em pouco tempo, eles estão espionando cada detalhe da vida do casal e elaborando um plano divertidamente diabólico para acabar de uma vez por todas com esse romance. Mas as coisas não estão saindo exatamente como eles haviam planejado!","first_air_date":"1997-05-23","runtime":100,"episode_run_time":[100],"vote_average":6.1,"created_by":["Warner Bros. Pictures","Miramax","Outlaw Productions"],"production_companies":[{"name":"Warner Bros. Pictures"},{"name":"Miramax"},{"name":"Outlaw Productions"}],"cast":["Meg Ryan","Matthew Broderick","Kelly Preston","Tchéky Karyo","Maureen Stapleton"],"backdrop_path":"https://image.tmdb.org/t/p/original/35b11n97MKmmkjJoJcx8tqHIVJ2.jpg","poster_path":"https://image.tmdb.org/t/p/original/zIywifuccMTmObadWPahAkVR3gr.jpg","certification":"N/A","genres":["Comédia","Romance"],"trailer":"N/A"},
