"36801":{"id":"36801","name":"Caindo no Mundo","slug":"caindo-no-mundo","original_title":"Cemetery Junction","overview":"A década de 1970 chegou. Os tempos estão mudando. Mas nem tudo está na mesma sintonia. Escrita por Ricky Gervais e Stephen Merchant, uma nova comédia hilária e tocante sobre três amigos que sonham livrar-se da vidinha pacata e acomodada de Cemetery Junction. Cientes de que não podem passar o resto de suas vidas bebendo, brigando e aprontando, eles são forçados a tomarem uma atitude. Nada é tão simples como gostariam, principalmente porque um deles se apaixona pela filha do chefe, e para complicar um pouco mais, a moça está noiva. Para alcançarem o que desejam, eles terão de se rebelar contra as regras, custe o que custar.","first_air_date":"2010-04-14","runtime":94,"episode_run_time":[94],"vote_average":6.5,"created_by":["Gervais/Merchant"],"production_companies":[{"name":"Gervais/Merchant"}],"cast":["Christian Cooke","Tom Hughes","Jack Doolan","Felicity Jones","Ralph Fiennes"],"backdrop_path":"https://image.tmdb.org/t/p/original/pZeOUR7fNfXdSZJhWLnReK8kaJi.jpg","poster_path":"https://image.tmdb.org/t/p/original/gl5f9ytqQtzk4fHlVqlirGo6JBd.jpg","certification":"N/A","genres":["Drama","Comédia"],"trailer":"N/A"},
