"18725":{"id":"18725","name":"O Justiceiro","slug":"o-justiceiro","original_title":"給爸爸的信","overview":"Mestre em artes marciais e lutador, Kung Wei, vive numa casa humilde, com a esposa que está muito doente e com Johnny, seu filho que o adora e segue seus ensinamentos morais e de artes marciais. Kung Wei, é \"recrutado\" sigilosamente pela polícia, para disfarçado, desmantelar uma quadrilha em Hong Kong. Enquanto trabalhava com outra identidade, seu filho sofria com seus colegas que chamavam o pai de \"bandido\"; pois, a ele imputavam um crime. Neste meio tempo, sua esposa morre. Antes de morrer, ela confia a guarda do pequeno Johnny, ao policial que \"investigava\" Kung, supondo que se marido fosse um bandido perigoso. O mestre Kung Wei, terá que lutar muito nessa missão!","first_air_date":"1995-03-02","runtime":104,"episode_run_time":[104],"vote_average":6.6,"created_by":["Win's Entertainment Ltd."],"production_companies":[{"name":"Win's Entertainment Ltd."}],"cast":["Jet Li","谢苗","梅艷芳","Blackie Ko Shou-Liang","于荣光"],"backdrop_path":"https://image.tmdb.org/t/p/original/aAhljX3GsM5k2NgIXHIVDDGKcu2.jpg","poster_path":"https://image.tmdb.org/t/p/original/eoqPa4v4xd3l84ahEbx4edot2GB.jpg","certification":"N/A","genres":["Ação","Crime","Thriller"],"trailer":"N/A"},
