"32654":{"id":"32654","name":"Grandes Guerreiros","slug":"grandes-guerreiros","original_title":"風雲II","overview":"Storm Warriors é a sequência de Storm Riders, de 1998. Baseado na história escrita por Wing-Shing Ma, desta vez Wind e Cloud têm que enfrentar Lord Godless, um poderoso guerreiro chinês que quer conquistar a China, e seu filho, Heart. Lord Godless aprisiona um grande número de mestres das artes marciais na tentativa de subjulgá-los. Entre os presos estão Cloud (Aaron Kwok) e o veterano mestre Nameless (Kenny Ho). Wind (Ekin Cheng) vem em socorro deles e o trio é gravemente ferido por Lord Godlesss em ataque de artes marciais malignas. Os mestres restantes sacrificam suas vidas para salvar o trio, esperando que eles vençam Lord Godless um dia e salvem o país. Para derrotá-lo, tanto Cloud como Wind têm que treinar para aumentar suas habilidades nas artes marciais. Wind envereda-se pelo caminho do mal, e Cloud segue o caminho normal. Wind torna-se demoníaco, então cabe a Cloud pará-lo antes que ele cause mais destruição.","first_air_date":"2009-12-10","runtime":110,"episode_run_time":[110],"vote_average":6.1,"created_by":["Universe Films Distribution","Chengtian Entertainment","Sil-Metropole Organisation"],"production_companies":[{"name":"Universe Films Distribution"},{"name":"Chengtian Entertainment"},{"name":"Sil-Metropole Organisation"}],"cast":["郭富城","鄭伊健","任達華","謝霆鋒","蔡卓妍"],"backdrop_path":"https://image.tmdb.org/t/p/original/tNf1h0dJ6grkW0Pt50xPJhTZM5l.jpg","poster_path":"https://image.tmdb.org/t/p/original/1YB9YlgdR4AkJetkjtH1BriVrQ2.jpg","certification":"N/A","genres":["Ação","Aventura","Fantasia"],"trailer":"N/A"},
