"7985":{"id":"7985","name":"Penelope","slug":"penelope","original_title":"Penelope","overview":"Há muitos anos, uma criada da família Wilhern engravidou do filho do patrão, mas ele não se casou com ela, pois pertencia a uma classe social inferior. A moça suicidou-se e sua mãe, que era uma bruxa, amaldiçoou as filhas da família Wilhern: a partir desse dia, elas nasceriam com nariz de porco. A maldição só seria quebrada se elas encontrassem o verdadeiro amor. Penelope foi a primeira filha legítima a nascer na família após várias gerações, e tinha nariz de porco. Por esta razão, sua mãe a escondia do mundo na mansão da família, e a menina cresceu sozinha e sem amigos. Quando cresceu, seus pais passaram a procurar um noivo, para que casasse a maldição fosse quebrada.","first_air_date":"2006-03-01","runtime":104,"episode_run_time":[104],"vote_average":6.7,"created_by":["Summit Entertainment","Tatira-Hiller Productions","Grosvenor Park Media","Type A Films"],"production_companies":[{"name":"Summit Entertainment"},{"name":"Tatira-Hiller Productions"},{"name":"Grosvenor Park Media"},{"name":"Type A Films"}],"cast":["Christina Ricci","James McAvoy","Catherine O'Hara","Reese Witherspoon","Peter Dinklage"],"backdrop_path":"https://image.tmdb.org/t/p/original/kbD1di34NzIJAhorYxUob1PR7cR.jpg","poster_path":"https://image.tmdb.org/t/p/original/IVHd5MnQpUJUW5jkZuYrxtqDTc.jpg","certification":"N/A","genres":["Fantasia","Comédia","Romance"],"trailer":"dKQozz49md0"},
"7095":{"id":"7095","name":"Jack","slug":"jack","original_title":"Jack","overview":"Como qualquer garoto de 10 anos, Jack (Robin Williams) quer ir à escola e brincar com outras crianças. Só que ele não é um garoto comum: portador de uma doença rara, Jack envelhece quatro vezes mais rápido que o normal, fazendo dele um menino em corpo de homem. No primeiro dia de aula, Jack descobre que não cabe na cadeira e nem entre seus colegas de classe que o consideram mais uma aberração do que um amigo. Depois de seu encontro com as garotas e de uma noite trágica na casa da árvore, a escola se transforma na maior aventura de sua vida.","first_air_date":"1996-08-09","runtime":113,"episode_run_time":[113],"vote_average":6.3,"created_by":["Hollywood Pictures","Great Oaks Entertainment","American Zoetrope"],"production_companies":[{"name":"Hollywood Pictures"},{"name":"Great Oaks Entertainment"},{"name":"American Zoetrope"}],"cast":["Robin Williams","Diane Lane","Brian Kerwin","Jennifer Lopez","Bill Cosby"],"backdrop_path":"https://image.tmdb.org/t/p/original/v9wC8Rf3RHYQ6yKO4yQAlQLHSA6.jpg","poster_path":"https://image.tmdb.org/t/p/original/9W6UI8UQ4YdLCAaPFd0lcKJ1tX4.jpg","certification":"10","genres":["Comédia","Família","Drama"],"trailer":"N/A"},
