"22829":{"id":"22829","name":"Quando Paris Alucina","slug":"quando-paris-alucina","original_title":"Paris When It Sizzles","overview":"Richard Benson (William Holden), escritor criativo mas sem muita disposição para o trabalho, prefere se divertir em vez de escrever o roteiro encomendado por Alexander Meyerheim (Noel Coward), produtor de Hollywood, que gostou do título da história prometida por ele: \"A Moça que Roubou a Torre Eiffel\". Para entregar o trabalho, Richard contrata Gabrielle Simpson (Audrey Hepburn), uma secretária temporária.","first_air_date":"1964-03-01","runtime":110,"episode_run_time":[110],"vote_average":6.3,"created_by":["Paramount Pictures","Richard Quine Productions","George Axelrod Productions"],"production_companies":[{"name":"Paramount Pictures"},{"name":"Richard Quine Productions"},{"name":"George Axelrod Productions"}],"cast":["William Holden","Audrey Hepburn","Grégoire Aslan","Raymond Bussières","Christian Duvaleix"],"backdrop_path":"https://image.tmdb.org/t/p/original/nhsjEEct8f4GDDSAvkpEJJWfuf2.jpg","poster_path":"https://image.tmdb.org/t/p/original/uBjD5sKjIGynfpktoa7cIwfLg6k.jpg","certification":"10","genres":["Romance","Comédia"],"trailer":"N/A"},
